import "./DropdownIconMenu.css"

export default function DropdownIconMenu() {
    return (
        <div>
            <div className="menu">
                <button> Menu item 1 </button>
                <button> Menu item 2 </button>
                <button> Menu item 3 </button>
              </div>
        </div>
    )
}
